WorkflowProcessEvent.eventDescription:
function afterProcessCreate(processId){
	
	hAPI.setCardValue("vl_num_solic",processId);
	
	hAPI.setCardValue("matriculaAutor", getValue("WKUser"));
	
	hAPI.setCardValue("campoDescritor", processId);
	
}

function beforeCancelProcess(colleagueId,processId){
	
	var numState = getValue("WKNumState");
	 var process = getValue("WKNumProces");
	 var message = "";

	 if(numState != 0 && numState != 3 ) {
	    message += "- É necessario o uso do processo de <strong><u>PR-012.01 - Cancelamento de Viagens.";
	 }
	 if (message != "") throw message;
}

function beforeTaskSave(colleagueId,nextSequenceId,userList){
	
	 var numState = getValue("WKNumState");
	 var process = getValue("WKNumProces");
	 var message = "";

	 if((numState == 34 && hAPI.getCardValue("rb_aprovador_especial") == "Aprovado") && hAPI.listAttachments().size() < 1 ) {
	    message += "É necessario anexar o relatório de autorização Especial.";
	 }

	 if (message != "") throw message;
	
}

function beforeStateEntry(sequenceId){
	
	log.info("Controle Viagem beforeStateEntry "+sequenceId);
	
	var numState = getValue("WKNumState");
	var usuario = '';
	var senha = '';
	//buscando dados da etapa selecionada	
	var idDocumento = hAPI.getCardValue("documentoIdViajante");
	var saldo = hAPI.getCardValue("valNovoSaldoDiarias");
	
	var u1 = DatasetFactory.createConstraint("userIntegration", "integrador", "integrador", ConstraintType.MUST);
	//var u2 = DatasetFactory.createConstraint("empresaFluig", "1", "1", ConstraintType.MUST);
	//var constraints2 = new Array(u1,u2);
	var constraints2 = new Array(u1);
	var dsConexao = DatasetFactory.getDataset("geral_parametros_customizacoes", null, constraints2, null);
	
	log.info("Total registros dsConexao: " + dsConexao.rowsCount);
	
	if(dsConexao != null && dsConexao.rowsCount > 0){
		
		usuario = dsConexao.getValue(0, 'userIntegration');
		senha = dsConexao.getValue(0, 'passwordIntegration');
		
		log.info("Usuario: " + usuario);
		log.info("Senha: " + senha);
	}

	if (numState == 0 || numState == 3){
		
		log.info("Alterando Saldo: "+saldo);
		
		var f1 = DatasetFactory.createConstraint("ID_DOC", idDocumento, idDocumento, ConstraintType.MUST);
		var f2 = DatasetFactory.createConstraint("USUARIO", usuario, usuario, ConstraintType.MUST);
		var f3 = DatasetFactory.createConstraint("SENHA", senha, senha, ConstraintType.MUST);
		var f4 = DatasetFactory.createConstraint("SALDO", saldo, saldo, ConstraintType.MUST);
		var f5 = DatasetFactory.createConstraint("TIPO", "SALDO", "SALDO", ConstraintType.MUST);
				
		var constraints = new Array(f1,f2,f3,f4,f5);
		var dsUpdateViajante = DatasetFactory.getDataset("ds_update_viajante", null, constraints, null);
		console.dir(dsUpdateViajante);
		
		if (dsUpdateViajante == undefined || dsUpdateViajante.values == undefined){
			throw "dsUpdateViajante não encontrado.";
		} 
		
	} else if ( numState == 34 && hAPI.getCardValue("rb_aprovador_especial") == "Aprovado"){ //Solicitar Autorização Especial  && (hAPI.getCardValue("rb_aprovador_especial") == "Aprovado")
		
		log.info("Valor: "+hAPI.getCardValue("rb_aprovador_especial"));
		
		var f1 = DatasetFactory.createConstraint("ID_DOC", idDocumento, idDocumento, ConstraintType.MUST);
		var f2 = DatasetFactory.createConstraint("USUARIO", usuario, usuario, ConstraintType.MUST);
		var f3 = DatasetFactory.createConstraint("SENHA", senha, senha, ConstraintType.MUST);
		var f4 = DatasetFactory.createConstraint("SALDO", saldo, saldo, ConstraintType.MUST);
		var f5 = DatasetFactory.createConstraint("TIPO", "MSG", "MSG", ConstraintType.MUST);
				
		var constraints = new Array(f1,f2,f3,f4,f5);
		var dsUpdateViajante = DatasetFactory.getDataset("ds_update_viajante", null, constraints, null);
		console.dir(dsUpdateViajante);
		
		if (dsUpdateViajante == undefined || dsUpdateViajante.values == undefined){
			throw "dsUpdateViajante não encontrado.";
		} 
	}
	
}
